import React from "react";
import Square from "./Square";

function Game() {
    return (
        <div className="container">
            <div className="game">
                <div className="game-board">
                    <div className="board-row">
                        {renderSquare(0)}
                        {renderSquare(1)}   {/* This is the top horizontal row...*/}
                        {renderSquare(2)}
                    </div>
                    <div className="board-row">
                        {renderSquare(3)}
                        {renderSquare(4)}   {/* This is the middle row...*/}
                        {renderSquare(5)}
                    </div>
                    <div className="board-row">
                        {renderSquare(6)}
                        {renderSquare(7)}   {/* This is the bottom horizontal row...*/}
                        {renderSquare(8)}
                    </div>
                </div>
            </div>
        </div>
    );
}

function renderSquare(i) {
    return <Square
        value={i}
        onClick={null}
    />;
}

export default Game;
